schemaDefinition: "create or replace view STRATEGIC_EVENTS_EXHIBITOR_CATALOG(\n\t\"\
  ExhibitorID\",\n\t\"ExhibitorName\",\n\t\"ExhibitorDescription\",\n\t\"ExhibitorItemStatus\"\
  ,\n\t\"ExhibitorType\",\n\t\"ExhibitorEvent\",\n\t\"ExhibitorDemoLocation\",\n\t\
  \"ExhibitorDemoCategory\",\n\t\"ExhibitorDemoBusinessUnit\",\n\t\"ExhibitorDemoScanMethod\"\
  ,\n\t\"ExhibitorEloquaCampaignID\"\n) as\nSELECT \"EXHIBITOR_ID\" as \"ExhibitorID\"\
  ,\n       \"NAME\" as \"ExhibitorName\",\n       \"DESCRIPTION\" as \"ExhibitorDescription\"\
  ,\n       \"ITEM_STATUS\" as \"ExhibitorItemStatus\",\n       \"TYPES\" as \"ExhibitorType\"\
  ,\n       \"EVENTS\" as \"ExhibitorEvent\",\n       \"SKODEMOS_LOCATION\" as \"\
  ExhibitorDemoLocation\",\n       \"SKODEMOS_CATEGORY\" as \"ExhibitorDemoCategory\"\
  ,\n       \"SKODEMO_BUSINESS_UNIT\" as \"ExhibitorDemoBusinessUnit\",\n       \"\
  SKODEMOS_-_SCAN_METHOD\" as \"ExhibitorDemoScanMethod\",\n       \"ELOQUACAMPAIGNID\"\
  \ as \"ExhibitorEloquaCampaignID\"\nFROM\n  (SELECT \"EXHIBITOR_ID\" as \"EXHIBITOR_ID\"\
  ,\n          \"NAME\" as \"NAME\",\n          \"DESCRIPTION\" as \"DESCRIPTION\"\
  ,\n          \"ITEM_STATUS\" as \"ITEM_STATUS\",\n          \"TYPES\" as \"TYPES\"\
  ,\n          \"EVENTS\" as \"EVENTS\",\n          \"SKODEMOS LOCATION\" as \"SKODEMOS_LOCATION\"\
  ,\n          \"SKODEMOS CATEGORY\" as \"SKODEMOS_CATEGORY\",\n          \"SKODEMO\
  \ BUSINESS UNIT\" as \"SKODEMO_BUSINESS_UNIT\",\n          \"SKODEMOS - SCAN METHOD\"\
  \ as \"SKODEMOS_-_SCAN_METHOD\",\n          \"ELOQUACAMPAIGNID\" as \"ELOQUACAMPAIGNID\"\
  \n   FROM \"RDS\".\"FLATFILESOURCE\".\"STRATEGIC_EVENTS_EXHIBITOR_CATALOG\")Projection_1;"
